import './Style.css'

const Home = () => {
    return (
        <div className="container col-sm-6">
            <div className="row justify-content-center m-2">
                <h2>Welcome to Home Page</h2>
               
            </div> 
            <div className="row justify-content-center align-items-center m-2">
                    <h5>We have Total 300 Customers</h5>
            </div>
        </div>
    );
};

export default Home;
